(66, 4, 'boAt Airdopes 381 Bluetooth Headset(Active Black, True Wireless)', '', 'Tune into Nirvana with boAt Airdopes 381 TWS earbuds to enjoy your music in a truly wireless way. The TWS Airdopes 381 comes equipped with 7mm rhythmic dynamic drivers for immersive, HD sound. The latest Bluetooth v5.0 offers seamless instant connectivity', 'https://rukminim1.flixcart.com/image/200/200/k4ss2a80/headphone/u/j/h/boat-airdopes-382-original-imafn7f2nyfyzqr4.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 4990, 4990, 0, 'Flipkart', '', 0, 0, 0, 0, 'boAt', 'https://www.flipkart.com/boat-airdopes-381-bluetooth-headset/p/itmf080b41286b75?pid=ACCFSDGSJTWSWHYD', 59),
(67, 4, 'realme Buds Wireless Bluetooth Headset(Yellow, Wireless in the ear)', '', 'Bring home these earphones from Realme and let high-quality audio enthral you. Tuned and optimised by the famous DJ, Alan Walker, these lightweight earphones offer you a battery life of about 12 hours, so you can immerse yourself in crystal-clear audio fo', 'https://rukminim1.flixcart.com/image/200/200/k2arbm80/headphone/c/v/m/realme-buds-original-imafhzf2yxgn8hyh.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 1999, 1999, 0, 'Flipkart', '', 0, 0, 0, 0, 'realme', 'https://www.flipkart.com/realme-buds-wireless-bluetooth-headset/p/itm00465e702b1aa?pid=ACCFHGZFS7GB9CVM', 10),
(68, 0, 'realme Buds 2 Wired Headset(Black, Wired in the ear)', '', 'Hear every soundtrack even more clearly when you use these Realme Buds 2 earphones. They come with the powerful 11.2-mm bass boost driver for elevated bass response. Moreover, these stylishly designed earphones have integrated magnets which offer a hassle', 'https://rukminim1.flixcart.com/image/200/200/k20r8nk0/headphone/7/w/c/realme-buds-2-original-imafhgrckbygsyrk.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 799, 799, 0, 'Flipkart', '', 0, 0, 0, 0, 'realme', 'https://www.flipkart.com/realme-buds-2-wired-headset/p/itmd133c94c44d50?pid=ACCFKYE2ARGG67WC&affid=sachineve', 25),
(69, 4, 'Zebronics ZEB-COUNTY 3 W Bluetooth  Speaker(Black, Mono Channel)', '', 'WIRELESS BT SPEAKER,CALL FUNCTION,FM RADIO,USB,MICRO SD SLOT,AUX SLOT,MEDIA / VOLUME CONTROL', 'https://rukminim1.flixcart.com/image/200/200/k69ncsw0/speaker/mobile-tablet-speaker/7/g/q/zebronics-zeb-county-original-imafzrpeutbegxjh.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 999, 999, 0, 'Flipkart', '', 0, 0, 0, 0, 'Zebronics', 'https://www.flipkart.com/zebronics-zeb-county-3-w-bluetooth-speaker/p/itme650688555488?pid=ACCFKTGTVDTHF7GQ', 37),
(70, 3, 'boAt Rugby 10 W Portable Bluetooth  Speaker(Blue, Stereo Channel)', '', 'With this Bluetooth speaker from boAt, you can carry your party with you wherever you go. Equipped with the state-of-the-art boAt technology and an external boAt passive radiator, along with two drivers, this speaker delivers rich and powerful audio. Powe', 'https://rukminim1.flixcart.com/image/200/200/k0vbgy80pkrrdj/speaker/mobile-tablet-speaker/h/5/n/boat-rugby-original-imafjyeucvwfzhvz.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 3990, 3990, 0, 'Flipkart', '', 0, 0, 0, 0, 'boAt', 'https://www.flipkart.com/boat-rugby-10-w-portable-bluetooth-speaker/p/itmbfcc356f4108c?pid=ACCE9CZGAJPTFDTQ&affid=sachineve', 63),
(71, 4, 'boAt Stone Grenade 5 W Portable Bluetooth  Speaker(Charcoal Black, Mono Channel)', '', 'Listen to music in stellar quality with this boAt speaker. With a multitude of features, such as 7-hours of playback time, water-resistant, and easy access control, this speaker ensures a fulfilling aural experience.', 'https://rukminim1.flixcart.com/image/200/200/k0vbgy80pkrrdj/speaker/mobile-tablet-speaker/4/n/n/boat-stone-grenade-original-imafg96ffpnpgdv4.jpeg?q=90', 'uploads/products/no(1).jpg', 'uploads/products/no(2).jpg', 'uploads/products/no(3).jpg', 3990, 3990, 0, 'Flipkart', '', 0, 0, 0, 0, 'boAt', 'https://www.flipkart.com/boat-stone-grenade-5-w-portable-bluetooth-speaker/p/itm0f38c2f530da5?pid=ACCFDBFR9ZCZTDGJ&affid=sachineve', 63),
